// React
import React from 'react';

// Components
import AccountNavigation from '../components/account/accountNavigation/AccountNavigation';

const Account = () => {
  return (
    <div className="wrapper">
      <center><h1>Account</h1></center>
      <AccountNavigation />
    </div>
  );
};

export default Account;
